function App() {
  return (
    <div>
      <Layout>
        <Switch>
          <Route path="/" exact>
            <AllMeetupsPage />
          </Route>
          <Route path="/new-meetup">
            <NewMeetupsPage />
          </Route>
          <Route path="/favorites">
            <FavoritesPages />
          </Route>
        </Switch>
      </Layout>
    </div>
  );
}

export default App;
